script: |
  super -f text -I q9786.spq | sort > q9786.out

inputs:
  - name: q9786.spq
    data: |
      SELECT ALL - col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - col1 * + col2 + col0 + col2 * - col2 * - col0 NOT IN ( - col0 * - tab0.col1 );
  - name: tab0

outputs:
  - name: q9786.out
    data: |
